class HomeComponent {
    constructor(dataService) {
        this.dataService = dataService;
        this.totalActive = 0;
        this.totalRecovered = 0;
        this.totalDeath = 0;
        this.totalConfirmed = 0;
        this.datatable = [];
        this.pieChart = {
            chartType: 'PieChart',
        };
        this.columnChart = {
            chartType: 'ColumnChart',
        };
    }
    ngOnInit() {
        this.dataService.getData().subscribe({
            next: (result) => {
                this.globalData = result;
                result.forEach(cs => {
                    if (!Number.isNaN(cs.confirmed)) {
                        this.totalActive += cs.active;
                        this.totalRecovered += cs.recovered;
                        this.totalConfirmed += cs.confirmed;
                        this.totalDeath += cs.death;
                    }
                });
                this.initChart('r');
            }
        });
    }
    updateChart(input) {
        console.log('Update me hai', input.value);
        this.initChart(input.value);
    }
    initChart(caseType) {
        console.log('idhar hai', caseType);
        this.datatable = [];
        this.datatable.push(["Country", "Cases"]);
        this.globalData.forEach(cs => {
            let value;
            if (caseType == 'a')
                if (cs.active > 2000) {
                    this.datatable.push([
                        cs.country, cs.active
                    ]);
                }
            if (caseType == 'd')
                if (cs.death > 1000) {
                    this.datatable.push([
                        cs.country, cs.death
                    ]);
                }
            if (caseType == 'r')
                if (cs.recovered > 2000) {
                    this.datatable.push([
                        cs.country, cs.recovered
                    ]);
                }
        });
        console.log(this.datatable);
        this.pieChart = {
            chartType: 'PieChart',
            dataTable: this.datatable,
            options: {
                height: 500,
            },
        };
        this.columnChart = {
            chartType: 'ColumnChart',
            dataTable: this.datatable,
            options: {
                height: 500,
                animation: {
                    duration: 1000,
                    easing: 'out',
                }
            },
        };
    }
}
